import React from 'react';
import Navbar from './NavBar';
import './App.css';
import './style.css';



function App() {
  return (
    <>
    <Navbar />
    <div className='containerInto'>
    <div className='code'>
      I am Hezron, a computer enthusiastic, I am into programming and cyber security, this is my first portfolio project. Hopefully we get to know each other much<hr>  </hr>
    </div>
    </div>

    </>
  );
}

export default App;
